svg.script:
// handle restart of animation on click
window.onload = function() {
  var animation_duration = 10,
      svg_root, svg_scene;

  // get SVG root element
  svg_root = document.getElementsByTagName('svg')[0];

  // get SVG scene
  svg_scene = document.getElementById('Scene_1_l1');

  // SVG animation starts when `start` custom event is being triggered
  function start_hero_animation() {
    // reset animation time and start over
    svg_root.setCurrentTime(0);

    var e = document.createEvent('Event');
    e.initEvent('start', false, false);
    svg_scene.dispatchEvent(e);
  };

  // restart the animation only once finished
  function restart_hero_animation(e) {
    if (typeof e !== 'undefined') {
      e.stopPropagation();
    }

    // if animation hasn't finished then skip
    if (svg_root.getCurrentTime() < animation_duration) {
      return false;
    }

    start_hero_animation();
  };

  // hack: start it immediately and pause the animation so as user doesn't
  //       see the last slide as the first one

  // pause all animations
  svg_root.pauseAnimations();

  // start animation
  start_hero_animation();

  // also, setTimeout is used so as autoplay works on Safari too
  setTimeout(function() {
    start_hero_animation();
  }, 0);

  // on first load, start animation a bit later
  setTimeout(function() {
    // unpause animations
    svg_root.unpauseAnimations();

    // bind on click event so as user can restart the animation
    svg_scene.addEventListener('click', restart_hero_animation, false);
  }, 1000);
}
